import "../CSS/App.css";
import { AdvancedChart, TickerTape } from "react-tradingview-embed";

function App() {
    return (
        <div className="Home">
            <div className="tape">
                <TickerTape
                    widgetProps={{
                        symbols: [
                            { description: "Ford", proName: "NYSE:F" },
                            { description: "SPY", proName: "NYSE:SPY" },
                            { description: "AAPL", proName: "NYSE:AAPL" },
                            { description: "GE", proName: "NYSE:GE" },
                        ],
                        theme: "dark",
                    }}
                />
            </div>
            <div className="winrate"></div>
            <div className="details"></div>

            <AdvancedChart
                className="chart"
                widgetProps={{
                    symbol: "SPY",
                    theme: "dark",
                }}
            />

            <div className="positions"></div>
        </div>
    );
}

export default App;
